//src/components/Timeline.js

import React from "react";
import "./Timeline.css";

const Timeline = () => {
  return (
    <div className="timeline-container">
      <div className="post">
        <p>P 1</p>
      </div>
      <div className="post">
        <p>Post de exemplo 2</p>
      </div>
    </div>
  );
};

export default Timeline;
